import React from "react";
import music_logo from "./music1.jpeg";
import './projects_page.css';


const Projects = () => {

        const defaultOptions = {
            reverse:        false,  // reverse the tilt direction
            max:            35,     // max tilt rotation (degrees)
            perspective:    1000,   // Transform perspective, the lower the more extreme the tilt gets.
            scale:          1.1,    // 2 = 200%, 1.5 = 150%, etc..
            speed:          3000,   // Speed of the enter/exit transition
            transition:     true,   // Set a transition on enter/exit.
            axis:           null,   // What axis should be disabled. Can be X or Y.
            reset:          true,    // If the tilt effect has to be reset on exit.
            easing:         "cubic-bezier(.03,.98,.52,.99)",    // Easing on enter/exit.
        }




    return (
        <div className="projects-container">
            <h1 className="tc white">Projects</h1>
            <div className="project">
                <div className="text-project">
                    <h2 className="white">Debut Python Project: Video Downloads & Music Playback</h2>
                    <p className="white">My debut Python project introduces me to programming.<br />It employs a library for hassle-free video downloads from links.<br /> The user-centric GUI empowers users to pick folders for downloads or music playback.<br /> MP3s can be directly saved or played in the chosen folder. <br /> Future enhancements paused to prioritize other projects.</p>
                    <br />
                    <p><a href="https://github.com/RegiLoshi/Python-Music-Player-and-Downloader" target="_blank" rel="noopener noreferrer">Press to go to the Github page...</a></p>
                </div>
                <img src={music_logo} alt="Music App" target='_blank' />
            </div>
        </div>
    )
}

export default Projects;
